import React from 'react';
import './IconSuccess.css';
import { GrCheckmark } from 'react-icons/gr';
import { TweenMax } from 'gsap';


// Return Icon Success 
export default function ReturnIconSuccess() {

 React.useEffect(() => {
  TweenMax.from('.wrp-subicon-success', 1.2, { delay: 0.3, opacity: 0, y: 0, scale: 1, ease: Power3.easeIn });

 }, []);

 return (
  <div className='wrp-icon-success'>
   <div className='wrp-subicon-success'>
    <GrCheckmark size={'1.4em'} />
   </div>

  </div>
 );
};
